import styled from '@emotion/styled'

const Diapazon = styled.h3`
    font-family: Jost;
    font-weight: 400;
    font-size: 18px;
    line-height: 26px;
    color: #000000;
`

const Calendar = () => (
    <div>
        <Diapazon>27 июля – 2 августа 2020 г.</Diapazon>
    </div>
)

export default Calendar;
